import React, { useEffect, useState } from 'react';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

export default function MyOrder() {
  const [orderData, setOrderData] = useState([]);

  const fetchMyOrder = async () => {
    try {
      const userEmail = localStorage.getItem('userEmail');
      const response = await fetch("http://localhost:5000/api/myOrderData", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          email: userEmail
        })
      });

      if (response.ok) {
        const data = await response.json();
        setOrderData(data);
      } else {
        console.error('Failed to fetch order data');
      }
    } catch (error) {
      console.error('Error fetching order data:', error);
    }
  };

  useEffect(() => {
    fetchMyOrder();
  }, []);

  return (
    <>
      <div>
        <Navbar />
      </div>

      <div className='container'>
        <div className='row'>
          {orderData.length > 0 ? (
            orderData.map((order) => (
              <div key={order.orderId} className='col-12 col-md-6 col-lg-3'>
                <div className="card mt-3" style={{ width: "16rem", maxHeight: "360px" }}>
                  <img src={order.img} className="card-img-top" alt="..." style={{ height: "120px", objectFit: "fill" }} />
                  <div className="card-body">
                    <h5 className="card-title">{order.name}</h5>
                    <div className='container w-100 p-0' style={{ height: "38px" }}>
                      <span className='m-1'>{order.qty}</span>
                      <span className='m-1'>{order.size}</span>
                      <span className='m-1'>{order.Order_date}</span>
                      <div className='d-inline ms-2 h-100 w-20 fs-5'>â‚¹{order.price}/-</div>
                    </div>
                  </div>
                </div>
              </div>
            ))
          ) : (
            <p>No orders found.</p>
          )}
        </div>
      </div>

      <Footer />
    </>
  );
}
